servers.mdDescription:
Konfigurace serverů MCP pomocí příkazů, argumentů, volitelně proměnných prostředí a autostartu (ve výchozím nastavení true). Každý server je identifikován jedinečným klíčem, například "brave-search" nebo "filesystem". Chcete-li spustit server, použijte příkaz "MCP: Start MCP Server", který umožňuje vybrat požadovaný server. Chcete-li server zastavit, použijte příkaz "MCP: Stop MCP Server". Upozorňujeme, že autostart se projeví až po restartu, poprvé je třeba server spustit ručně.
Příklad konfigurace:
```{
  "brave-search": {
    "command": "npx",
    "args": [
      "-y",
      "@modelcontextprotocol/server-brave-search"
    ],
    "env": {
      "BRAVE_API_KEY": "YOUR_API_KEY"
    },
  },
  "filesystem": {
    "command": "npx",
    "args": ["-y", "@modelcontextprotocol/server-filesystem", "/Users/YOUR_USERNAME/Desktop"],
    "env": {
      "CUSTOM_ENV_VAR": "custom-value"
    },
    "autostart": false
  }
}
```
